import { useState } from "react";
import "./Newpost.css";

const TextHandler = (e) => {
  const [inputText, setInputText] = useState("");
  setInputText(e.target.value);
};

const Newpost = (props) => {
  return <input type="text" value="write" onchange={TextHandler}></input>;
};

export default Newpost;
